export const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: '제로초',
      },
      content: '첫 번째 게시글 #해시태그 #익스페리스',
      Images: [
        {
          src: '/Users/supercoder/develop/reactSocial/prepare/front/img/Img1.png',
        },
      ],
      Comments: [
        {
          User: {
            nickname: 'hypercoder',
          },
          content: 'hello world',
        },
      ],
      ImagePaths: [],
    },
  ],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
